            <div className="count" style={{display: flex;
  padding: 20px;}}onClick={setCount(5)}>
              <p>Clear All</p>
              <img src="delete.png" alt="delet" className="count-del" />
            </div>
          </div>
        </div>
      </div> */}
    </div>
  );
}

export default TaskBoard;
